import styled from "styled-components";

const ErrorPageWrapper = styled.div`
  .container-fluid {
    background-image: url(${(props) => props.cover});
    background-position: center center;
    background-size: cover;
    height: 100vh;
  }
`;

export default ErrorPageWrapper;
